import { TOGGLE_CART_HIDDEN } from './cart.constants'

export const toggleCartHidden = () => ({
  type: TOGGLE_CART_HIDDEN,
})


import { SET_CURRENT_USER } from './user.constants'

export const setCurrentUser = (user) => ({
  type: SET_CURRENT_USER,
  payload: user,
})
